+----------------+
|Game Description|
+----------------+

A non-stop explosion of adorable matching action.. from PopCap! They're cute. They're cuddly. They're explosive! And there's only one way to make these googly-eyed furballs happy: give 'em a pop! Just slide, prod and nudge the chuzzles to match three or more, and send fur flying and eyeballs bouncing! Break free from puzzle locks, and boost your score with colorful cascades and combos. Brighten your day by making Rainbow, Giant and Super chuzzles. There's never a dull moment.. so pop your way to an overflowing Trophy Room today!

Originally released May 12th, 2005.

+----------------------------------+
|Instructions / System Requirements|
+----------------------------------+

No install or crack is required for this portable version. Extract the ZIP file and create a shortcut to the executable (EXE) to play.

This game is compatible with Windows 2000, XP, Vista(32/64bit) and 7(32/64bit). Requires DirectX 8.0 or later. Processor requirements: 700MHz CPU or higher. RAM requirements: 256 MB or higher. Requires a DirectX-compatible Sound and Video card with at least 16 MB of video memory.

